方法：四个角不断定边界不断缩小范围
参考
思路：通过左上角，右上角，左下角，右下角4个点不断收缩来确定打印范围

func spiralOrder(matrix [][]int) []int {
    if len(matrix) == 0 || len(matrix[0]) == 0 {
        return nil
    }

    l, r, t, d := 0, len(matrix[0])-1, 0, len(matrix)-1
    res := []int{}
    for {
        //打印上面一行
        for i := l; i  d {
            break
        }
        for i := t; i  r {
            break
        }
        for i := r; i >= l; i-- {
            res = append(res, matrix[d][i])
        }
        d -= 1
        if t > d {
            break
        }
        for i := d; i >= t; i-- {
            res = append(res, matrix[i][l])
        }
        l += 1
        if l > r {
            break
        }
    }

    return res
}

