    }
}

func (this *MinStack) Pop()  {
    //如果数据栈没有内容直接不弹出
    if this.DataStack.Len() != 0 {
        this.DataStack.Remove(this.DataStack.Back())
        this.MinValueStack.Remove(this.MinValueStack.Back())
    }
}


