type Node struct {
    Val    int
    Next   *Node
    Random *Node
}


func copyRandomList(head *Node) *Node {
    //如果链表为空
    if head == nil {
        return nil
    }

    //第1步：在每个节点后边建立一个节点，并连接起来
    cur := head
    for cur != nil {
        cur.Next = &Node{
            Val:    cur.Val,
            Next:   cur.Next,
            Random: cur.Random,
        }
        cur = cur.Next.Next
    }

    //第2步：将新建立的每个节点的Random指针指向正确方向
    cur = head.Next
    for cur != nil {
        if cur.Random != nil {
            cur.Random = cur.Random.Next
        }

        //如果是最后一个节点
        if cur.Next != nil {
            cur = cur.Next.Next
        } else {
            break
        }
    }

    //第3步：将奇数节点与偶数节点对应的两个链表分开
    cur = head.Next
    odd, even := head, head.Next
    for odd != nil {
        if even.Next != nil {
            odd.Next, even.Next = odd.Next.Next, even.Next.Next
            odd, even = odd.Next, even.Next
        } else {         //如果最后两个节点
            odd.Next = odd.Next.Next
            break
        }
    }

    return cur
}

