方法一：迭代
思路：首先计算两个链表公共部分的和，然后计算剩余链表与carry的和。
注意：最后可能会两个链表遍历完，但是还有进位，此时我们需要新建一个节点存放进位

执行用时：12 ms, 在所有 Go 提交中击败了73.46%的用户
        内存消耗：5 ms, 在所有 Go 提交中击败了91.50%的用户

func addTwoNumbers(l1 *ListNode, l2 *ListNode) *ListNode {
    if l1 == nil {
        return l2
    }

    if l2 == nil {
        return l1
    }

    dummyNode := &ListNode{} //用来当做返回结果的链表头部
    head := dummyNode
    carry := 0 //用来记录进位
    val := 0   //用来记录当前两节点对应值的和

    //两链表都不空的时候
    for l1 != nil && l2 != nil {
        val = l1.Val + l2.Val + carry
        //注意点1：注意carry写在这里
        //每次都需要重置进位
        carry = val / 10
        //建立当前节点
        node := &ListNode{
            Val: val % 10,
        }
        head.Next = node
        l1, l2, head = l1.Next, l2.Next, head.Next
    }

    //以下两个条件只会满足一个
    //若l1不空
    for l1 != nil {
        val = l1.Val + carry
        //注意点1：注意carry写在这里
        //每次都需要重置进位
        carry = val / 10
        node := &ListNode{Val: val % 10}
        head.Next = node
        l1, head = l1.Next, head.Next
    }

    //若l2不空
    for l2 != nil {
        val = l2.Val + carry
        //注意点1：注意carry写在这里
        //每次都需要重置进位
        carry = val / 10
        node := &ListNode{Val: val % 10}
        head.Next = node
        l2, head = l2.Next, head.Next
    }

    //如果链表都遍历完成，但是最后还是有进位
    //此时还是要创建一个节点
    //例如：输入 第1个链表为5  输入第2个链表也是5
    if carry > 0 {
        head.Next = &ListNode{Val: carry}
    }
    return dummyNode.Next
}

方法二：递归
思路：递归将链表中的两数相加合并为6种如下情况，代码中有注释

若l1, l2 都为空，且进位为0，直接返回nil

若l1为空, l2 不空，且进位为0，直接返回l2

若l2为空, l1 不空，且进位为0，直接返回l1

若l1为空, l2 不空，且进位不为0，需要不断计算l2与进位

若l1不空, l2 空，且进位不为0，需要不断计算l1与进位

若l1不空, l2 不空，需要不断计算l1+l2+进位



