func swapPairs(head *ListNode) *ListNode {

    if head == nil || head.Next == nil {
        return head
    }

    prev, cur := head, head
    prev = nil
    ret := head.Next

    for cur != nil && cur.Next != nil {
        if prev != nil {
            prev.Next = cur.Next
        }
        cur.Next, cur.Next.Next, prev, cur = cur.Next.Next, cur, cur, cur.Next.Next
    }

    return ret

}

