func plusOne(digits []int) []int {
    for i := len(digits)-1; i >= 0; i-- {
        //如果当前位不是9，加一后直接返回
        if digits[i] != 9 {
            digits[i] += 1
            return digits
        }
        //如果当前位是9，说明该位会变成0
        digits[i] = 0
    }

    //走到最后，说明还有1个1要加到最前面
    digits[0] = 1

    //最后还要加上0
    return append(digits, 0)
}

