func deleteDuplicates(head *ListNode) *ListNode {
    if head == nil {
        return head
    }
    node := head
    for node.Next != nil {
        if node.Val == node.Next.Val {
            //记得清楚野指针
            node.Next, node.Next.Next = node.Next.Next, nil
        } else {
            node = node.Next
        }
    }

    return head
}

