func singleNumber(nums []int) []int {

    xorRet := 0
    for _, num := range nums {
        xorRet ^= num
    }

    //取到异或结果中的最低位
    mask := (xorRet & (-xorRet))

    //根据这一位将数据分成两组
    first, second := 0, 0
    for _, num := range nums {
        if mask & num != 0 {
            first ^= num
        } else {
            second ^= num
        }
    }

    //最后的每组对应的数便是结果
    return []int{first, second}

}

